import React from "react";
import "./App.css";

import { motion } from "framer-motion";

import "bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div>
      <motion.div
        animate={{ x: 100 }}
        transition={{ ease: "easeOut", duration: 2 }}
      />
      <h1>Hello My Name is Manuel</h1>
      <motion.div />
    </div>
  );
}

export default App;
